import React from 'react';
import axios from 'axios';

class Map extends React.Component {
    constructor() {
        super();
        this.state = {
            city: "Hollywood",
            state: ""
        }
    }


    return() {
        <div className="map-screen">
            <iframe
                id="map-view"
                className="map-view"
                width="850px"
                height="600px"
                src={`https://www.google.com/maps/embed/v1/place?key=AIzaSyAxrGSdDukOL15sBwLLANcanGnQD8KJzaw
                    &q=${city}, ${state}`}>
            </iframe>
        </div>
    }
}
export default Map;
